      }
      render(){
         return (
           <div className="Playlist">
             <input value={this.props.playlistName}/>
             {renderTracks(this.props.playlistTracks)}
             <button className="Playlist-save">SAVE TO SPOTIFY</button>
           </div>
         );
      }
  }

export default Playlist;
